        }


        function renderPageExercise() {
            gappedTextAreaGen.innerHTML = '';
            wordBankAreaGen.innerHTML = '';

            pageExerciseState.textSegments.forEach(segment => {
                if (typeof segment === 'string') {
                    gappedTextAreaGen.appendChild(document.createTextNode(segment));
                } else {
                    const gapSpan = document.createElement('span');
                    gapSpan.id = segment.id;
                    gapSpan.classList.add('gap');
                    gapSpan.dataset.correctWord = segment.correctWord;
                    gapSpan.textContent = segment.currentWordText ? segment.currentWordText : '________';
                    if(segment.currentWordText) gapSpan.dataset.currentWordId = segment.currentWordId;
                    else delete gapSpan.dataset.currentWordId;
                    
                    gapSpan.classList.remove('correct-answer', 'incorrect-answer');
                    addPageDropTargetListeners(gapSpan);
                    gappedTextAreaGen.appendChild(gapSpan);
                    // Store reference to the element in the state for easy access later (e.g., for checkAnswers)
                    segment.element = gapSpan; 
                }
            });

            pageExerciseState.draggableWords.forEach(wordObj => {
                if (!wordObj.isPlaced) {
                    const wordDiv = document.createElement('div');
                    wordDiv.id = wordObj.id;
                    wordDiv.classList.add('draggable-word');
                    wordDiv.textContent = wordObj.text;
                    wordDiv.draggable = true;
                    addPageDraggableListeners(wordDiv);
                    wordBankAreaGen.appendChild(wordDiv);
                }
            });
        }

        function addPageDraggableListeners(element) {
            element.addEventListener('dragstart', (e) => {
                e.dataTransfer.setData('text/plain', JSON.stringify({
                    wordId: element.id,
                    wordText: element.textContent,
                    sourceType: element.parentElement.id === 'word-bank-area-generated' ? 'bank' : 'gap',
                    sourceId: element.parentElement.id !== 'word-bank-area-generated' ? element.parentElement.id : null
                }));
                e.target.classList.add('dragging');
            });
            element.addEventListener('dragend', (e) => e.target.classList.remove('dragging'));
        }

        function addPageDropTargetListeners(element) {
            element.addEventListener('dragover', (e) => { 
                e.preventDefault(); 
                document.querySelectorAll('.gap.drag-over').forEach(el => el.classList.remove('drag-over'));
                if(element.classList.contains('gap')) element.classList.add('drag-over'); 
            });
            element.addEventListener('dragleave', (e) => { 
                 if (element.classList.contains('gap') && e.relatedTarget && !element.contains(e.relatedTarget)) {
                    element.classList.remove('drag-over');
                } else if (!e.relatedTarget && element.classList.contains('gap')) { 
                    element.classList.remove('drag-over');
                }
            });
            element.addEventListener('drop', handlePageDrop);
        }
        addPageDropTargetListeners(wordBankAreaGen); // Also make word bank a drop target

        function handlePageDrop(e) {
            e.preventDefault();
            document.querySelectorAll('.gap.drag-over').forEach(el => el.classList.remove('drag-over'));
            
            const data = JSON.parse(e.dataTransfer.getData('text/plain'));
            const draggedWordId = data.wordId;
            const draggedWordText = data.wordText;
            const sourceType = data.sourceType;
            const sourceId = data.sourceId;

            const targetElement = e.target.closest('.gap, #word-bank-area-generated');
            if (!targetElement) return;

            const draggedWordState = pageExerciseState.draggableWords.find(w => w.id === draggedWordId);

            if (targetElement.classList.contains('gap')) {
                const targetGapId = targetElement.id;
                const targetGapState = pageExerciseState.textSegments.find(s => typeof s !== 'string' && s.id === targetGapId);

                if (targetGapState.currentWordId && targetGapState.currentWordId !== draggedWordId) { 
                    const wordInGapState = pageExerciseState.draggableWords.find(w => w.id === targetGapState.currentWordId);
                    if (wordInGapState) wordInGapState.isPlaced = false;
                }
                
                targetGapState.currentWordText = draggedWordText;
                targetGapState.currentWordId = draggedWordId;
                if(draggedWordState) draggedWordState.isPlaced = true;


                if (sourceType === 'gap' && sourceId !== targetGapId) {
                    const sourceGapState = pageExerciseState.textSegments.find(s => typeof s !== 'string' && s.id === sourceId);
                    if (sourceGapState) { sourceGapState.currentWordText = null; sourceGapState.currentWordId = null; }
                }
            } else if (targetElement.id === 'word-bank-area-generated') {
                if (sourceType === 'gap') {
                    const sourceGapState = pageExerciseState.textSegments.find(s => typeof s !== 'string' && s.id === sourceId);
                    if (sourceGapState) { sourceGapState.currentWordText = null; sourceGapState.currentWordId = null; }
                    if(draggedWordState) draggedWordState.isPlaced = false;
                }
            }
            renderPageExercise();
        }

        checkButtonGen.addEventListener('click', () => {
            let allCorrect = true;
            let hasMissingGaps = false;

            pageExerciseState.textSegments.forEach(segment => {
                if (typeof segment !== 'string' && segment.isGap && segment.element) {
                     segment.element.classList.remove('correct-answer', 'incorrect-answer');
                }
            });
            
            pageExerciseState.textSegments.forEach(segment => {
                if (typeof segment !== 'string' && segment.isGap) {
                    const gapElement = segment.element; // Use stored reference
                    if (!segment.currentWordText) {
                        hasMissingGaps = true;
                    } else {
                        if (segment.currentWordText.trim() !== segment.correctWord.trim()) {
                            allCorrect = false;
                            if (gapElement) gapElement.classList.add('incorrect-answer');
                        } else {
                            if (gapElement) gapElement.classList.add('correct-answer');
                        }
                    }
                }
            });
            if (hasMissingGaps) { messageAreaGen.textContent = "Please fill all gaps. Keep trying."; messageAreaGen.style.color = 'orange';}
            else if (allCorrect) { messageAreaGen.textContent = "Great job!"; messageAreaGen.style.color = 'green'; }
            else { messageAreaGen.textContent = "Some answers are incorrect. Review the highlighted items."; messageAreaGen.style.color = 'red'; }
        });

        restartExerciseButtonGen.addEventListener('click', () => {
            pageExerciseState.textSegments.forEach(segment => {
                if (typeof segment !== 'string' && segment.isGap) {
                    segment.currentWordId = null;
                    segment.currentWordText = null;
                    if (segment.element) { // Check if element exists
                        segment.element.classList.remove('correct-answer', 'incorrect-answer');
                    }
                }
            });
            pageExerciseState.draggableWords.forEach(wordObj => {
                wordObj.isPlaced = false;
            });
            
            messageAreaGen.textContent = "Exercise restarted.";
            messageAreaGen.style.color = 'black';
            renderPageExercise(); 
        });
        
        renderPageExercise();
    </script>
</body>
</html>
